\documentclass{standalone}
\usepackage{pgfplots}
\pgfplotsset{compat=1.18}

\begin{document}
\begin{tikzpicture}
    \begin{axis}[
        width=8cm,
        height=8cm,
        xlabel={$\gamma$},
        ylabel={R-IGD},
        title={R-IGD},
        xmode=log,
        log basis x={10},
        legend style={at={(0.5,-0.15)},anchor=north,legend columns=-1},
        legend cell align={left},
        grid=major,
        ymin=0, ymax=0.3,
    ]

    % R-IGD(pop) data
    \addplot[
        color=blue,
        mark=x,
        mark options={scale=1.5},
        thick
    ]
    coordinates {
        (1e-4, 0.1)
        (1e-3, 0.11)
        (5e-2, 0.12)
        (1e0, 0.15)
    };

    % R-IGD(pred) data
    \addplot[
        color=orange,
        mark=triangle*,
        mark options={scale=1.5},
        thick
    ]
    coordinates {
        (1e-4, 0.1)
        (1e-3, 0.12)
        (5e-2, 0.15)
        (1e0, 0.3)
    };

    % Shaded area for R-IGD(pop)
    \addplot [
        name path=pop_upper,
        draw=none,
        forget plot
    ] coordinates {
        (1e-4, 0.11)
        (1e-3, 0.12)
        (5e-2, 0.13)
        (1e0, 0.16)
    };

    \addplot [
        name path=pop_lower,
        draw=none,
        forget plot
    ] coordinates {
        (1e-4, 0.09)
        (1e-3, 0.1)
        (5e-2, 0.11)
        (1e0, 0.14)
    };

    \addplot [
        blue!20,
        forget plot
    ]
    fill between[
        of=pop_upper and pop_lower,
    ];

    % Shaded area for R-IGD(pred)
    \addplot [
        name path=pred_upper,
        draw=none,
        forget plot
    ] coordinates {
        (1e-4, 0.11)
        (1e-3, 0.13)
        (5e-2, 0.18)
        (1e0, 0.32)
    };

    \addplot [
        name path=pred_lower,
        draw=none,
        forget plot
    ] coordinates {
        (1e-4, 0.09)
        (1e-3, 0.11)
        (5e-2, 0.12)
        (1e0, 0.28)
    };

    \addplot [
        orange!20,
        forget plot
    ]
    fill between[
        of=pred_upper and pred_lower,
    ];

    \legend{R-IGD(pop), R-IGD(pred)}

    \end{axis}
\end{tikzpicture}
\end{document}
```

This code sets up a plot using logarithmic scaling on the x-axis and includes both data lines with markers and shaded regions representing one standard deviation. The colors and markers are chosen to match the description, and the legend is positioned below the plot.

